import React from 'react';

import styles from './Subheader.module.css';

const subheader = () => {
    return (
        <div id={styles.subheader}>
            <Header
            icon = {aboutIcon} 
            title = "Interests & Experience" 
                subtitle = "My areas of interests and acquired skills" 
            />
        </div>
    )
}

export default subheader;
